@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM rdf:type owl:Class .
atm:Account rdf:type owl:Class .
atm:Bank rdf:type owl:Class .
atm:CashCard rdf:type owl:Class .
atm:Customer rdf:type owl:Class .

atm:ownsCard rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:belongsToBank rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:hasAccount rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:cardIssuedBy rdf:type owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:Request rdf:type owl:Class ;
    rdfs:subClassOf [ rdf:type owl:Restriction ;
                      owl:onProperty atm:belongsToBank ;
                      owl:someValuesFrom atm:Bank ] .

atm:Response rdf:type owl:Class ;
    rdfs:subClassOf [ rdf:type owl:Restriction ;
                      owl:onProperty atm:belongsToBank ;
                      owl:someValuesFrom atm:Bank ] .

atm:ErrorMessage rdf:type owl:Class ;
    rdfs:subClassOf [ rdf:type owl:Restriction ;
                      owl:onProperty atm:belongsToBank ;
                      owl:someValuesFrom atm:Bank ] .

atm:hasResponseTime rdf:type owl:DatatypeProperty ;
    rdfs:domain atm:Response ;
    rdfs:range xsd:integer .

atm:hasErrorMessage rdf:type owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:ErrorMessage .

atm:CardRejected rdf:type owl:Class ;
    rdfs:subClassOf [ rdf:type owl:Restriction ;
                      owl:onProperty atm:hasErrorMessage ;
                      owl:someValuesFrom atm:ErrorMessage ] .

atm:CardRejected rdfs:subClassOf [ rdf:type owl:Restriction ;
                                   owl:onProperty atm:hasResponseTime ;
                                   owl:allValuesFrom [ rdf:type owl:Restriction ;
                                                       owl:onDatatype xsd:integer ;
                                                       owl:withRestrictions ( [ xsd:minExclusive 120 ] ) ] ] .
